function generateKitchenFurniture(p, furniture, collisonObj) {
    let posX = p.width/1.06
    let posY =  p.height/2
    let kitchenCounterSpecs = {posX: p.width/8, posY:p.height/7, width: p.width/5, height:p.height/6 }
    let coffeeTable1Specs = {posX: p.width/8, posY:p.height/2.3, width: p.width/5, height:p.height/6 }
    let coffeeTable2Specs = {posX: p.width/8, posY:p.height/2.3, width: p.width/5, height:p.height/6 }
    let coffeeTable3Specs = {posX: p.width/8, posY:p.height/7, width: p.width/5, height:p.height/6 }
    let coffeeTable4Specs = {posX: p.width/8, posY:p.height/7, width: p.width/5, height:p.height/6 }
    let kitchenCounter = new Furniture(p, furniture[12], kitchenCounterSpecs.posX, kitchenCounterSpecs.posY, kitchenCounterSpecs.width, kitchenCounterSpecs.height, collisonObj)
    let coffeeTable1 = new Furniture(p, furniture[19], coffeeTable1Specs.posX, coffeeTable1Specs.posY, coffeeTable1Specs.width, coffeeTable1Specs.height, collisonObj)
    let coffeeTable2 = new Furniture(p, furniture[19], coffeeTable2Specs.posX, coffeeTable2Specs.posY, coffeeTable2Specs.width, coffeeTable2Specs.height, collisonObj)
    let coffeeTable3 = new Furniture(p, furniture[19], coffeeTable3Specs.posX, coffeeTable3Specs.posY, coffeeTable3Specs.width, coffeeTable3Specs.height, collisonObj)
    let coffeeTable4 = new Furniture(p, furniture[19], coffeeTable4Specs.posX, coffeeTable4Specs.posY, coffeeTable4Specs.width, coffeeTable4Specs.height, collisonObj)

    kitchenCounter.render()
    coffeeTable1.render()
    coffeeTable2.render()
    coffeeTable3.render()
    coffeeTable4.render()

    
}

export default generateKitchenFurniture
